// This is the Navigation Bar
import './App.css';
import { Link } from "react-router-dom"
import App from './App'


function Header() {

  return (
    <div className="Header">
      <Link to='/App'>
        <button className="Home" aria-label="Home">
          Home
        </button>
      </Link>
    </div>

  );
}

export default Header;
